INSERT INTO `items` VALUES (1,3,NULL,10.80,0.00,26.17,'预科系入行论教材(全9册)','images/ruxinglun.jpg','索达吉堪布',NULL,0),(2,3,NULL,8.40,0.00,22.30,'预科系加行教材(全7册)','images/jiaxing.jpg','索达吉堪布',NULL,0),(3,3,NULL,8.40,0.00,19.28,'预科系净土教材(全7册)','images/jingtu.jpg','索达吉堪布',NULL,0),(4,1,NULL,0.77,0.00,0.00,'共修与辅导规范手册与共修示范视频','images/shangshi.jpg','索达吉堪布','详尽介绍何谓佛教的“闻思”，手把手教你如何学习佛法。',0),(5,1,NULL,0.00,0.00,0.21,'生死救度','images/shengsi.jpg','索达吉堪布','索达吉上师亲自编辑的放生仪轨和助念往生仪轨，是学会放生和助念的指定念诵仪轨。',0),(6,1,NULL,0.00,0.00,0.65,'菩提路灯','images/shangshi.jpg','索达吉堪布','含索达吉上师在2008年-2016年期间给学会写的公开信、所做的重要开示以及教务处发布的《学会管理系列通知（1-5）》，是学会管理和发展的重要文件。',0),(7,1,NULL,1.24,0.00,3.46,'離幸福很近','images/xingfu.jpg','索达吉堪布','人人都在寻求幸福，但幸福究竟是什么？在这个浮躁而复杂的时代中，如果没有找对方法，反而会带来更大的痛苦。\n本书关注当下社会现状，针对现代人的思想误区，以浅显易懂的语言，让我们得到佛教中的宁静心灵，帮我们认清幸福、接近幸福，得到一份幸福的保险。',0),(8,3,NULL,0.75,0.00,0.75,'前行实修法','images/shangshi.jpg','索达吉堪布',NULL,0),(9,2,NULL,0.78,0.00,0.93,'“压力山大”（大学演讲13）','images/shangshi.jpg','索达吉堪布',NULL,0),(10,2,NULL,0.78,0.00,1.07,'一切从心开始（大学演讲9）','images/shangshi.jpg','索达吉堪布',NULL,0),(11,2,NULL,0.78,0.00,1.41,'佛教眼中的神秘（大学演讲2)','images/shangshi.jpg','索达吉堪布',NULL,0),(12,2,NULL,0.78,0.00,1.29,'冲破迷暗的曙光（大学演讲7）','images/shangshi.jpg','索达吉堪布',NULL,0),(13,2,NULL,0.78,0.00,1.01,'发掘永远的财富（大学演讲11）','images/shangshi.jpg','索达吉堪布',NULL,0),(14,2,NULL,0.78,0.00,1.55,'只为一颗“心”（大学演讲14）','images/shangshi.jpg','索达吉堪布',NULL,0),(15,2,NULL,0.78,0.00,0.99,'唤醒深藏的善（大学演讲15）','images/shangshi.jpg','索达吉堪布',NULL,0),(16,2,NULL,0.72,0.00,1.00,'寻觅失落的文明（大学演讲17）','images/shangshi.jpg','索达吉堪布',NULL,0),(17,2,NULL,0.78,0.00,1.24,'寻觅爱的足迹（大学演讲6）','images/shangshi.jpg','索达吉堪布',NULL,0),(18,2,NULL,0.00,0.00,1.00,'年轻人也需要佛教（大学演讲20）','images/shangshi.jpg','索达吉堪布',NULL,0),(19,2,NULL,0.78,0.00,1.35,'心灵的诺亚方舟（大学演讲1）','images/xinling320.jpg','索达吉堪布',NULL,0),(20,2,NULL,0.78,0.00,1.52,'心病还须心药医（大学演讲3）','images/shangshi.jpg','索达吉堪布',NULL,0),(21,2,NULL,0.78,0.00,1.29,'必须面对的真相（大学演讲5）','images/shangshi.jpg','索达吉堪布',NULL,0),(22,2,NULL,0.78,0.00,1.29,'打开心扉的密钥（大学演讲8）','images/shangshi.jpg','索